Description.
Protoconch multispiral (about 1.75 whorls), planispiral, smooth (
Fig. 79A
), transition to teleoconch I marked by apertural varix (
Fig. 79A
). Teleoconch I short, smooth with weak axial growth lines (
Fig. 79B
), transition to teleoconch II marked by axial incised line (
Figs. 79A, D
). Teleoconch II about 2.5 times length of teleoconch I, sculptured with axial growth marks, transition to teleoconch III marked by change in sculpture (
Fig. 79D
). Teleoconch III sculptured with low, developing axial ribs (
Fig. 79E
), transition to teleoconch IV marked by change in sculpture (
Figs. 79
F–G). Teleoconch IV sculptured with flattened axial ribs and fine, dense, longitudinal striae in interspaces (
Fig. 79F
), transition to teleoconch V marked by suture, followed by change in sculpture (
Fig. 79H
). Teleoconch V sculptured with numerous, round to flattened ribs (
Figs. 79I, K
), transition to teleoconch VI marked by suture followed by increase in diameter (
Fig. 79K
). Teleoconch VI (last growth stage) average size for genus [Tol 
2.50–2.80 mm
], tubular, thick, stout, moderately and regularly arched [Larc: 
0.80–0.90 mm
; Arc: 
0.26–0.30 mm
], subcylindrical with slight increase in diameter from posterior to aperture, cream to light brown (
Figs. 78
A–B). Axial sculpture of 30–40 closely arranged, round to flattened ribs (
Figs. 79J, L
). Axial interspaces rather deep, vary in width (
Figs. 79J, L
). Surface smooth to glossy, with dense striae in interspaces (
Figs. 79J, L
). Striae easily worn away. Posterior [Dpe: 
0.45–0.48 mm
] with thick edge, squared shoulder (
Fig. 78C
). Septum mucronate, slightly protruding (
Fig. 78C
). Mucro with rounded point, positioned on dorsal margin (
Fig. 78C
). Aperture [Da: 
0.48–0.62 mm
] thick, slightly constricted (
Fig. 78C
). No varix. Lip smooth, with deflected peristome (
Fig. 78C
). Periostracum thin, smooth, light brown (
Fig. 78A
). Operculum thin, light brown; exterior surface with 6–7 concentric rings (
Figs. 78
D–E). Conceptual reconstruction of growth stages shown in 
Fig. 80A
.
